import React from 'react';
import QuoteItem from './QuoteItem';

const Quotes = (quotes, count) => {
  return <div className={quoteStyle} />;
};

const quoteStyle = {
  display: 'flexbox',
  flexDirection: 'column'
};

export default Quotes;
